import React from "react";
import { Loader } from "@googlemaps/js-api-loader";

const Map = () => {
  const [windowSize, setWindowSize] = useState({
    width: undefined,
    height: undefined
  });
  useEffect(() => {
    function handleResize() {
      setWindowSize({
        width: window.innerWidth,
        height: window.innerHeight
      });
    }
    window.addEventListener("resize", handleResize);
    handleResize();

    return () => window.removeEventListener("resize", handleResize);
  }, []);

  console.log(this.contentWindow);
  return (
    <div>
      <iframe
        style={{ border: 0, width: windowSize, height: windowSize }}
        // loading="lazy"
        allowFullScreen
        src="https://www.google.com/maps/embed/v1/place?key=AIzaSyD7PLVzeUB1KuZmQYV-kKnEAkdP1wY0iuY&q=Space+Needle,Seattle+WA"
      ></iframe>
    </div>
  );
};

export default Map;
